import React from 'react'
const Component = React.Component

class App extends Component {
    render() {
        return (
            <div>
                <div>
                    hello react
                </div>

                <ul className="list">
                    <li>{false?'tony.com':'tony'}</li>
                    <li>React app</li>
                </ul>

            </div>
        )
    }
}

export default App
